((function(){

var animation = function(){
	var body = $('rt-transition');
	
	if ((window.gecko && document.getElementsByClassName) || (window.trident && !document.querySelectorAll)){
		if (body){
			body.setStyles({'visibility': 'hidden', 'opacity': 0});
